import React from 'react';
import Top from '../Top/Top';
import Bottom from '../Bottom/Bottom';
import Img1 from '../images/수출통관.png';
import styles from './Aboutaone.module.css';


const CustomAone = () => {
    return (
    <div>
       
<Top />


<div className={styles.down}>수출통관</div>
<div class = "container">
<br /><br /> 
<img src ={Img1} alt='수출통관' /> 

</div>
<br /><br />  
<br /><br />
<Bottom />
        </div>
    );
};

export default CustomAone;
